import React, { Component } from 'react';
import {
  Button,
  Cell,
  Card,
  CardText,
  CardTitle,
  CardActions,
  CardMenu,
  Grid,
  IconButton,
  Tab,
  Tabs
} from 'react-mdl';

class Projects extends Component {
  constructor(props) {
    super(props);
    this.state = { activeTab: 0 };
  }

  toggleCategories() {
    if (this.state.activeTab === 0) {
      return (
        <div className='projects-grid'>
          {/* {Project 1} */}
          <Card shadow={0} style={{ width: '512px', margin: 'auto' }}>
            <CardTitle
              style={{
                color: '#fff',
                height: '176px',
                background:
                  'url(https://raddevon.com/wp-content/uploads/2018/10/react.jpg) center / cover'
              }}
            >
              Name of Project
            </CardTitle>
            <CardText>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris
              sagittis pellentesque lacus eleifend lacinia...
            </CardText>
            <CardActions border>
              <Button colored>GitHub</Button>
              <Button colored>Leve Demo</Button>
            </CardActions>
            <CardMenu style={{ color: '#fff' }}>
              <IconButton name='share' />
            </CardMenu>
          </Card>
        </div>
      );
    } else if (this.state.activeTab === 1) {
      return (
        // {Project 1}
        <Card shadow={0} style={{ width: '512px', margin: 'auto' }}>
          <CardTitle
            style={{
              color: '#fff',
              height: '176px',
              background:
                'url(https://raddevon.com/wp-content/uploads/2018/10/react.jpg) center / cover'
            }}
          >
            Name of Project
          </CardTitle>
          <CardText>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris
            sagittis pellentesque lacus eleifend lacinia...
          </CardText>
          <CardActions border>
            <Button colored>GitHub</Button>
            <Button colored>Leve Demo</Button>
          </CardActions>
          <CardMenu style={{ color: '#fff' }}>
            <IconButton name='share' />
          </CardMenu>
        </Card>
      );
    } else if (this.state.activeTab === 2) {
      return (
        // {Project 1}
        <Card shadow={0} style={{ width: '512px', margin: 'auto' }}>
          <CardTitle
            style={{
              color: '#fff',
              height: '176px',
              background:
                'url(https://raddevon.com/wp-content/uploads/2018/10/react.jpg) center / cover'
            }}
          >
            Name of Project
          </CardTitle>
          <CardText>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris
            sagittis pellentesque lacus eleifend lacinia...
          </CardText>
          <CardActions border>
            <Button colored>GitHub</Button>
            <Button colored>Leve Demo</Button>
          </CardActions>
          <CardMenu style={{ color: '#fff' }}>
            <IconButton name='share' />
          </CardMenu>
        </Card>
      );
    } else if (this.state.activeTab === 3) {
      return (
        // {Project 1}
        <Card shadow={0} style={{ width: '512px', margin: 'auto' }}>
          <CardTitle
            style={{
              color: '#fff',
              height: '176px',
              background:
                'url(https://raddevon.com/wp-content/uploads/2018/10/react.jpg) center / cover'
            }}
          >
            Name of Project
          </CardTitle>
          <CardText>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris
            sagittis pellentesque lacus eleifend lacinia...
          </CardText>
          <CardActions border>
            <Button colored>GitHub</Button>
            <Button colored>Leve Demo</Button>
          </CardActions>
          <CardMenu style={{ color: '#fff' }}>
            <IconButton name='share' />
          </CardMenu>
        </Card>
      );
    }
  }

  render() {
    return (
      <div className='category-tabs'>
        <Tabs
          activeTab={this.state.activeTab}
          onChange={tabId => this.setState({ activeTab: tabId })}
          ripple
        >
          <Tab>React</Tab>
          <Tab>Angular</Tab>
          <Tab>Javascript</Tab>
          <Tab>Node</Tab>
        </Tabs>
        <Grid>
          <Cell col={12}>
            <div className='content'>{this.toggleCategories()}</div>
          </Cell>
        </Grid>
      </div>
    );
  }
}

export default Projects;
